INSERT INTO `corpus_data` VALUES ('202', '向这段友谊致敬！', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('204', '敬爱的大山同志以冰心玉壶的精神传承了我们中华民族的伟大精神，使我们深受教育！赞', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('207', '最质朴的情感，却也是最值得我们尊敬的友情。大山老师走好，祝福友谊万岁。', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('208', '珍重使命，理敬人民！心中有人民，使命自担当！', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('209', '来自大山 书写大山 大美大山', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('211', '向大山致敬，向真挚的友谊致敬', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('212', '20年前的悼念，如今看依然感伤。 20年前的缅怀，如今看依然敬重。 20年前的品格，如今看依然值得我们一生追求。', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('213', '充满人性光辉的文字，给人力量，给人追求的方向。致敬！', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('214', '拜读了，情真意切，感动！', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('215', '传承精品，活跃创作，丰富文化', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('216', '再读此文，依旧感动，为的是那份最真挚的友情，还有默默奉献的精神', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('217', '真诚的交往、纯洁的友情，彰显了习近平总书记的人文情怀、人格魅力和人性光辉！', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('218', '娓娓道来，却又感人肺腑！', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('219', '款款深情，令人动容。真正诠释了忘年交的情谊二字，高山流水般的友谊', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('220', '人民的好作家，人民的好书记！君子之交淡如水，人民利益大于天！', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('221', '友谊历久弥新，文章千古不朽', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('222', '以笔为骨，以墨为魂，挺起文人的脊梁', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('223', '根植人民，必出精品。 学大山，写人民。', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('224', '友谊之树长青，平凡友谊暖心', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('225', '真正的文学是有力量的，有的人虽然去了，但是他留下了种子，这种子让无力者有力，让悲观者前行，让活着的人更有力量，这就是大山的力量，就是精神的力量！向大山致敬！向真挚的友情致敬！', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('226', '娓娓道来都是情，句句掂来忆大山', '16', null, '2017-02-21 09:47:20', '0');
INSERT INTO `corpus_data` VALUES ('227', '作家的笔只有忧国忧民才能创作出时代经典，贾大山做到了，他是燕赵儿女的骄傲', '16', null, '2017-02-21 09:47:20', '0');
