INSERT INTO `corpus_data` VALUES ('343', '可亲可敬的作家，很感动！', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('344', '友情不因岁月与分别而消散，却显得更加弥足珍贵。', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('345', '在广袤的燕赵大地，几千年的历史沉淀了这里丰厚的文化底蕴，自古多慷慨悲歌之士。在这片沃土里，也成就了一代作家贾大山。习总饱含深情地忆大山，其实也在点赞这里的人民。', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('346', '《忆大山》一文素朴的字里行间，流淌的是总书记待人、用人和交友的纯真质朴、坦荡胸襟，其宛如一泓泉水。读《忆大山》，可见总书记的高尚情操，朴实作风，平民情愫和家国情怀。', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('347', '一个虽然著名但并不算高产的作家，在身后能引起不同阶层人士如此强烈的反响，在文坛、在社会上能够得到如此丰厚的纪念文字，可见贾大山的人格和小说艺术是具有何等的魅力。', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('348', '学习大山精神，立足岗位，做好本职工作。', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('349', '满篇浓浓的情感 体现出主席对老友的深切怀念', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('350', '敬佩', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('351', '从贾大山简介，知道了他的诸多作品及影响力。从《忆大山》，了解了他很多优秀品格，以及总书记和他的真挚、深厚情谊', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('352', '昨天', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('353', '真情流露，感人肺腑，接地气。', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('354', '真情实感，友谊长存', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('355', '朴实无华的文字，深情厚谊的回忆，道出了作家的人格魅力，值得我们敬仰……', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('356', '河北的损失，文化届的损失', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('357', '在那个物质匮乏的年代，却有着如此牢固的友谊，让我们汗颜！', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('358', '真情实感，令人动容！', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('360', '人才在民间', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('361', '光明磊落、襟怀坦荡、真挚热情、善良正直的品格，怀念贾大山。', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('362', '句句流露出真挚的感情，让人被这份真挚的友情感动.', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('363', '他忧国忧民的情愫，清正廉洁、勤政敬业的作风，襟怀坦荡、真挚善良的品格，刚正不阿、疾恶如仇的精神，都将与他不朽的作品一样，长留人间。', '17', null, '2017-02-21 09:51:53', '0');
INSERT INTO `corpus_data` VALUES ('365', '何止一个情字，饱含泪水的眼中，是对人民的爱！hahahaah ', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('366', '人民的笔杆子，读者心中真正的力量源泉。', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('367', '如此接地气的作家，才是老百姓最喜欢的作家。', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('368', '深情回忆祭大师，朴实经典流百世', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('369', '老百姓喜爱的作家，人民怀念你', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('372', '深情回忆祭大师，朴实经典流百世。', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('374', '“学大山，写人民，出精品”---文艺来源于生活而高于生活，真正的大师一定是俯身于人民中，细细品味生活的人。这个浮躁的社会缺的就是这样的大师。无论是平凡如我们的普...', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('375', '文学是一束花，只有内心有温度的作家才能让它绽放，贾大山就是这样的一位作家，用暖心的情谊温暖百姓的心。', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('376', '清正廉洁。能在风云变化中运筹帷幄，在世事沧桑中度己度人，贾大山怀着一颗忧民为民的心，让现实中的我们触得到温暖，听得到心声！', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('377', '他的精神值得我们学习，他的情怀令我们感动！！！', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('378', '一个时代有一个时代的脉搏，他是真正的大者！', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('380', '为有这样的好作家而骄傲，他的文字必将激励我们不忘初心，继续前进！', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('381', '大山先生虽已逝，但是他的文字和他的精神的确如大山一样，依然挺立在中国人心中，历久弥坚。', '18', null, '2017-02-21 09:53:45', '0');
INSERT INTO `corpus_data` VALUES ('382', '20年的怀念，习大大对文化工作者的情怀让人感动，我们的文化繁荣离不开习大大的支持和鼓励。', '18', null, '2017-02-21 09:53:45', '0');
