-- Table structure for guide
-- ----------------------------
DROP TABLE IF EXISTS `guide`;
CREATE TABLE `guide` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userid` int(11) DEFAULT NULL COMMENT '发布人id',
  `name` varchar(500) DEFAULT NULL,
  `isApp` tinyint(255) DEFAULT '0' COMMENT '0电脑端 1安卓端 2IOS端',
  `category` int(11) DEFAULT NULL COMMENT '任务类型,对应task_category 中id',
  `address` varchar(500) DEFAULT NULL,
  `number` int(11) DEFAULT NULL,
  `status` tinyint(4) DEFAULT '1' COMMENT '1进行中 2完成 3暂停 4停止',
  `commentOrPost` int(11) DEFAULT '0' COMMENT '1同时评论 2同时转发',
  `corpus` int(11) DEFAULT '0' COMMENT '0自定义 1语料集中 2语料集中挑选',
  `account` tinyint(4) DEFAULT NULL COMMENT '账号类型 1自有 2公共 3自有和公共',
  `vControl` tinyint(4) DEFAULT NULL COMMENT '是否控量 0不控 1控',
  `startTime` datetime DEFAULT NULL,
  `spaceTimeStart` int(11) DEFAULT NULL,
  `spaceTimeEnd` int(11) DEFAULT NULL COMMENT '时间间隔结束',
  `weiboCategory` tinyint(4) DEFAULT NULL COMMENT '1新浪微博 2腾讯微博',
  `espeed` tinyint(4) DEFAULT NULL COMMENT '执行速度',
  `title` varchar(300) DEFAULT NULL,
  `publishTime` datetime DEFAULT NULL COMMENT '发布时间',
  `suc` int(11) DEFAULT '0' COMMENT '成功数量',
  `fail` int(11) DEFAULT '0' COMMENT '失败数',
  `praiseWho` varchar(100) DEFAULT NULL COMMENT '点赞对象',
  `praiseContent` varchar(300) DEFAULT NULL COMMENT '要赞内容',
  `grade` tinyint(4) DEFAULT '1' COMMENT '数字越大越优先执行',
  `status2` tinyint(4) DEFAULT '0' COMMENT '是否整体发送到mq 0没有,1有',
  `money` double DEFAULT '0',
  `taskid` int(11) DEFAULT NULL,
  `areaids` varchar(100) DEFAULT NULL COMMENT '所选择的区域',
  `uptime` datetime DEFAULT NULL,
  `type` varchar(255) DEFAULT NULL COMMENT '网站引导类型',
  `platid` int(11) DEFAULT NULL COMMENT '平台id',
  `isDel` tinyint(255) DEFAULT '0' COMMENT '1表示已经删除',
  `isJietu` tinyint(255) DEFAULT '0' COMMENT '0不调用截图脚本 1调用',
  `picData` blob,
  `notice` tinyint(255) DEFAULT '0' COMMENT '0不通知 1短信通知',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

