  `publishDate` date DEFAULT NULL,
  `starttime` datetime DEFAULT NULL,
  `endtime` datetime DEFAULT NULL,
  `execTime` datetime DEFAULT NULL COMMENT '最新执行时间',
  `status` int(10) unsigned zerofill NOT NULL COMMENT '1正在执行 2停止 3暂停',
