-- Function structure for queryChildrenDepartInfo
-- ----------------------------
DROP FUNCTION IF EXISTS `queryChildrenDepartInfo`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `queryChildrenDepartInfo`(deptid INT) RETURNS varchar(4000) CHARSET utf8
BEGIN
DECLARE sTemp VARCHAR(4000);
DECLARE sTempChd VARCHAR(4000);

SET sTemp = '-1';
SET sTempChd = cast(deptid as char);

WHILE sTempChd is not NULL DO
SET sTemp = CONCAT(sTemp,',',sTempChd);
SELECT group_concat(id) INTO sTempChd FROM department where FIND_IN_SET(fid,sTempChd)>0;
END WHILE;
return sTemp;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for queryFatherByDepart
-- ----------------------------
DROP FUNCTION IF EXISTS `queryFatherByDepart`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `queryFatherByDepart`(deptid INT) RETURNS int(11)
BEGIN
DECLARE sTemp INT;
DECLARE sTempF VARCHAR(100);

SET sTemp = -1;
SET sTempF = cast(deptid as char);

WHILE sTempF != '1' DO
SET sTemp = sTempF;
SELECT fid INTO sTempF FROM department where FIND_IN_SET(id,sTempF)>0 LIMIT 1;

END WHILE;
return sTemp;
END
;;
DELIMITER ;

